			<div className={`monster ${this.props.species}`} ref={this.props.ref}>
				<div className='head' />
				<div className='torso' />
				<div className='left-arm' />
				<div className='right-arm' />
				<div className='left-leg' />
				<div className='right-leg' />
			</div>
		)
	}

}
